import React from 'react';
import './Card.css';
import posed, {PoseGroup} from 'react-pose';

const MainCard = posed.div({
    enter: {
      y:0
    },
    exit: { y:-500 },
    duration:1
  });


const Card = ({children}) =>{
    return(
        <MainCard className="outerCard">
            {children}
        </MainCard>
    )
}

export default Card;
